function App() {
  const expenses = [
    { title: "Car Insurance", amount: 134.33, date: new Date(2022, 9, 24) },
    { title: "Car Insurance", amount: 134.33, date: new Date(2022, 9, 24) },
    { title: "Car Insurance", amount: 134.33, date: new Date(2022, 9, 24) },
  ];
  return (
    <div>
      <h2>Yo! Let's get started!!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

// 1. export the file
export default App;
